subjectSummaryRule:
'use strict';
({params, imports}) => {
    const {summaries, individual} = params;
    const _ = imports.lodash;
    var toalNonPregnantScreened = 0;
    var totalPregnantScreened = 0;
    var totalNonPregnantP = 0;
    var totalPregnantP = 0;
    var totalNonPregnantAS = 0;
    var totalPregnantAS = 0;
    var totalNonPregnantSS = 0;
    var totalPregnantSS = 0;
    _.forEach(individual.nonVoidedEncounters(), enc => {
        toalNonPregnantScreened = toalNonPregnantScreened + _.toNumber((enc.getObservationReadableValue('Number of non pregnant screened cases') || 0));
        totalPregnantScreened = totalPregnantScreened + _.toNumber((enc.getObservationReadableValue('Number of pregnant screened cases') || 0));
        totalNonPregnantP = totalNonPregnantP + _.toNumber((enc.getObservationReadableValue('Number of non pregnant solubility positive cases') || 0));
        totalPregnantP = totalPregnantP + _.toNumber((enc.getObservationReadableValue('Number of pregnant solubility positive cases') || 0));
        totalNonPregnantAS = totalNonPregnantAS + _.toNumber((enc.getObservationReadableValue('Number of non pregnant AS cases') || 0));
        totalPregnantAS = totalPregnantAS + _.toNumber((enc.getObservationReadableValue('Number of pregnant AS cases') || 0));
        totalNonPregnantSS = totalNonPregnantSS + _.toNumber((enc.getObservationReadableValue('Number of non pregnant SS cases') || 0));
        totalPregnantSS = totalPregnantSS + _.toNumber((enc.getObservationReadableValue('Number of pregnant SS cases') || 0));
    });
    summaries.push({name: "Total non pregnant screened cases", value: toalNonPregnantScreened});
    summaries.push({name: "Total pregnant screened cases", value: totalPregnantScreened});
    summaries.push({name: "Total non pregnant solubility positive cases", value: totalNonPregnantP});
    summaries.push({name: "Total pregnant solubility positive cases", value: totalPregnantP});
    summaries.push({name: "Total non pregnant AS cases", value: totalNonPregnantAS});
    summaries.push({name: "Total pregnant AS cases", value: totalPregnantAS});
    summaries.push({name: "Total non pregnant SS cases", value: totalNonPregnantSS});
    summaries.push({name: "Total pregnant SS cases", value: totalPregnantSS});
    summaries.push({name: "Sum of all samples (PW + NonPW)", value: toalNonPregnantScreened + totalPregnantScreened});
    summaries.push({name: "Sum of all Solubility Positive Cases (PW+NonPW)", value: totalPregnantP + totalNonPregnantP});
    summaries.push({name: "Sum of all AS cases (PW+NonPW)", value: totalNonPregnantAS + totalPregnantAS});
    summaries.push({name: "Sum of all SS cases (PW+NonPW)", value: totalPregnantSS + totalNonPregnantSS});
    return summaries;
};
